class Solution:
    def canChange(self, start: str, target: str) -> bool:
        n = len(start)
        l1=[]
        l2=[]
        r1=[]
        r2=[]
        
        for i in range(n):
            if start[i]=='L':
                l1.append(i)
            if start[i]=='R':
                r1.append(i)
            if target[i]=='L':
                l2.append(i)
            if target[i]=='R':
                r2.append(i)
        if len(l1)!=len(l2) or len(r1)!=len(r2):
            return False
        else:
            for i in range (len(l1)):
                if l1[i]<l2[i]:
                    return False
            for i in range (len(r1)):
                if r1[i]>r2[i]:
                    return False
        start = start.replace('_','')
        target = target.replace('_','')
        if start!=target:
            return False
        return True
